comment_text:
@NatashaVincent  thanks.  That's kinda what I do with the seniors.  I try to socialize with them. Lots of veitnam vets. I'm a Veteran also. Lots of old stories of their youth.  Interesting,  but when I try to get them motivated to get on a bus to go to the beach or walk to the near by pool or market, they decline.  

So, I'm hoping to some how get some pel grants to go to barber school,  to keep my mind learning something new and to earn some money. Also a good way to socialize.  Unfortunately,  pel grants are 10k short of paying for the whole course. I can't afford 10k , nor do I want to take a loan out at 64 years old. Lol

Workout is easy. Getting a job and socializing is the hard part as you get older. 🙁
